    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation.nn               American Indian tribal subdivisions are administrative subdivisions
    of federally recognized American Indian reservations/off-reservation trust lands
    orn               Oklahoma tribal statistical areas (OTSAs).  These entities are
    internal units of self-government and/or administration that serve social, cultural,n
                  and/or economic purposes for the American Indian tribe or tribes
    on the reservations/off-reservation trust lands or OTSAs.  The Census Bureau obtains
    then               boundary and attribute information for tribal subdivisions on
    federally recognized American Indian reservations and off-reservation trust lands
    fromn               federally recognized tribal governments through the Census Bureau's
    Boundary and Annexation Survey (BAS).  For the 2010 Census, the boundaries for tribaln
                  subdivisions on OTSAs were also obtained from federally recognized
    tribal governments through the Tribal Statistical Areas Program (TSAP).  Note thatn
                  tribal subdivisions do not exist on all reservations/off-reservation
    trust lands or OTSAs, rather only where they were submitted to the Census Bureau
    byn               the federally recognized tribal government for that area.  nn
                  The boundaries for American Indian tribal subdivisions are as of
    January 1, 2013, as reported by the federally recognized tribal governments through
    then               Census Bureau's Boundary and Annexation Survey (BAS).nn               The
    boundaries for tribal subdivisions on OTSAs are those reported as of January 1,
    2010 through TSAP.",nt"license_title": null,nt"extras": [{ntt"key":
